module.exports = (input, quantity = 3) => {
    const { window, document } = fetchSync.dom('http://www.startpage.com/do/search?query=' + encodeURIComponent(input));

    const results = [];
    [...document.querySelectorAll('.w-gl__result')]
        .slice(0, quantity)
        .forEach(node => {
            const title = node.querySelector('a').textContent.trim();
            const url = node.querySelector('a').href;
            results.push({ title, url });
        });
    return results;
};
